package org.apache.commons.dbcp2.datasources;

import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;
import java.lang.reflect.Method;

public class CharArrayTest1 {

    @Test
    public void testClearBehavior() throws Exception {
        // Test 1: Null-initialized CharArray
        CharArray nullInitialized = new CharArray((String) null);
        CharArray clearedNull = invokeClear(nullInitialized);
        char[] retrievedNullArray = invokeGet(clearedNull);
        assertNull(retrievedNullArray, "Array should be null after clearing null-initialized CharArray");

        // Test 2: Empty string-initialized CharArray
        CharArray emptyInitialized = new CharArray("");
        CharArray clearedEmpty = invokeClear(emptyInitialized);
        char[] retrievedEmptyArray = invokeGet(clearedEmpty);
        assertArrayEquals(new char[0], retrievedEmptyArray, "Array should be empty after clearing empty-initialized CharArray");

        // Test 3: Non-empty string-initialized CharArray
        CharArray nonEmptyInitialized = new CharArray("abc");
        CharArray clearedNonEmpty = invokeClear(nonEmptyInitialized);
        char[] retrievedNonEmptyArray = invokeGet(clearedNonEmpty);
        assertArrayEquals(new char[3], retrievedNonEmptyArray, "Array should be null-filled after clearing non-empty CharArray");
    }

    private CharArray invokeClear(CharArray instance) throws Exception {
        Method clearMethod = CharArray.class.getDeclaredMethod("clear");
        clearMethod.setAccessible(true);
        return (CharArray) clearMethod.invoke(instance);
    }

    private char[] invokeGet(CharArray instance) throws Exception {
        Method getMethod = CharArray.class.getDeclaredMethod("get");
        getMethod.setAccessible(true);
        return (char[]) getMethod.invoke(instance);
    }
}

