public class BasicDataSourceReadOnlyTest {

    @Test
    public void testReadOnlyStateTransitions() throws SQLException {
        // Step 0: Establish a fresh connection pooling system
        BasicDataSource connectionPoolingSystem = new BasicDataSource();

        // Step 1: Check the read-only setting when no preference has been set
        Boolean initialReadOnlyState = connectionPoolingSystem.getDefaultReadOnly();

        // Step 2: Verify the system indicates the read-only setting is absent
        Assertions.assertNull(initialReadOnlyState);

        // Step 3: Enable the read-only mode for the default user pool
        connectionPoolingSystem.setDefaultReadOnly(true);
        Boolean enabledReadOnlyState = connectionPoolingSystem.getDefaultReadOnly();

        // Step 4: Confirm the system reflects the enabled state
        Assertions.assertTrue(enabledReadOnlyState);

        // Step 5: Disable the read-only mode
        connectionPoolingSystem.setDefaultReadOnly(false);
        Boolean disabledReadOnlyState = connectionPoolingSystem.getDefaultReadOnly();

        // Step 6: Ensure the system accurately reports it as disabled
        Assertions.assertFalse(disabledReadOnlyState);

        // Step 7: Re-enable the read-only mode
        connectionPoolingSystem.setDefaultReadOnly(true);
        Boolean reEnabledReadOnlyState = connectionPoolingSystem.getDefaultReadOnly();

        // Step 8: Verify the system can toggle back to the enabled state successfully
        Assertions.assertTrue(reEnabledReadOnlyState);

        // Step 9: Clear the read-only preference entirely by removing any configured value
        connectionPoolingSystem.setDefaultReadOnly(null);
        Boolean clearedReadOnlyState = connectionPoolingSystem.getDefaultReadOnly();

        // Step 10: Confirm the system returns to indicating no read-only setting is present
        Assertions.assertNull(clearedReadOnlyState);

        // Step 11: Release the connection pooling system resources
        connectionPoolingSystem.close();
    }
}

